        Topic:
          'Sprawy bieżące. Informacje od Dyrekcji.\n\nPlan spotkania z rodzicami - 25.11.2021 r.\n\n1.Informacje na temat działalności szkoły (oddziaływanie promocyjne):\nzorganizowaliśmy Piknik Edukacyjny, V Bieg Niepodległości, Koncert Charytatywny;\nzorganizowaliśmy Powiatowe Konkursy z matematyki, j. angielskiego i j. niemieckiego dla uczniów szkół podstawowych i ponadpodstawowych;\nodbyły się wycieczki do Torunia w celu ponownego zintegrowania uczniów po okresie zdalnego nauczania;\nzostały przeprowadzone zajęcia wspomagające z j. polskiego, matematyki, \nj. angielskiego, historii, wosu, chemii i fizyki - łącznie 103 godziny lekcyjne;\nbierzemy udział w projekcie Nowe Horyzonty we współpracy z kinoteatrem Rondo - co miesiąc uczestniczymy w projekcji filmowej - do tej pory uczniowie klas 1 i klas 2 byli na seansach filmowych Komunia, Green Book;\naktywnie działa wolontariat;\nrealizowany jest projekt unijny - odbywają się zajęcia z matematyki, biologii, chemii, fizyki, geografii, j. angielskiego;\nodbędzie się wycieczka do Berlina na Jarmark Bożonarodzeniowy;\nw lutym odbędzie się Święto Szkoły - Dzień Patrona Mikołaja Kopernika;\n2.W klasach maturalnych informujemy o maturze próbnej Nowa Era, która odbędzie się w dniach 05 - 14.01.2022 r.\n3.Przypominamy, w szczególności w klasach pierwszych, że I semestr kończy się \n22 grudnia. W związku z tym:\ndo 17.12 do godz. 15.45 wystawienie ocen semestralnych\n20.12 Rada Pedagogiczna klasyfikacyjna\nnie wystawiamy ocen przewidywanych\n4.Przypominamy o terminie zimowej przerwy świątecznej i ferii zimowych. Informujemy o dniach dodatkowo wolnych od zajęć dydaktycznych.\n22.12.2021 r. spotkania świąteczne w klasach z wychowawcą, tego dnia lekcje się nie odbywają;\n23.12.2021 - 01.01. 2022 r. zimowa przerwa świąteczna;\n17 - 30.01.2022 r. ferie zimowe\n07.01.2022 r. \n02.05; 04-06.05.2022 r.\n17.06.2022 r.\n5.W ZSO nr 1 Dyrektor przyjął, że klasa ma zdalne nauczanie, gdy około 50 % uczniów tej klasy znajduje się na kwarantannie. \n6.W związku ze studniówką ustaliliśmy z klasą 3E, że jej koszt podzielimy na 2 raty: 1. wpłacamy w grudniu, a 2. w styczniu (każda rata po 100 zł).\n7.W naszej klasie ustaliliśmy też, że będziemy sobie robić prezenty bożonarodzeniowe - w granicy ok. 30 zł i wręczymy je w czasie klasowej Wigilii.',
